import React, { useCallback } from "react";
import styled from "styled-components";

const St = {
    Container: styled.div`
    width: 100%;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    background: rgba(0, 0, 0, 0.1);
  `,
    Login: styled.div`
    width: 30%;
    height: 600px;
    background: white;
    border-radius: 20px;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
  `,
    Head: styled.div`
    color: tomato;
    font-size: 2em;
  `,
    Login_sns: styled.div`
    padding: 20px;
    display: flex;
  `,
    Login_id: styled.div`
    margin-top: 20px;
    width: 80%;
  `,
    Login_id_input: styled.div`
    padding: 20px;
    display: flex;
  `,
};

const LoginForm = () => {
  return (
    <St.Container>
        <St.Login>
            <St.Head>Log-in</St.Head>
            <St.Login_sns>
            <li><a href=""><i class="fab fa-instagram"></i></a></li>
            <li><a href=""><i class="fab fa-facebook-f"></i></a></li>
            <li><a href=""><i class="fab fa-twitter"></i></a></li>
            </St.Login_sns>
            <St.Login_id>
                <h4>E-mail</h4>
                <Login_id_input type="email" name="" id="" placeholder="Email" />
            </St.Login_id>
            <Login_pw>
                <h4>Password</h4>
                <login_pw_input type="password" name="" id="" placeholder="Password" />
            </Login_pw>
            <Login_etc>
                <div>
                    <input type="checkbox" name="" id=""> Remember Me? </input>
                </div>
                <div class="forgot_pw">
                    <a href="">Forgot Password?</a>
                </div>
            </Login_etc>
            <Submit>
                <Submit_input type="submit" value="submit"></Submit_input>
            </Submit>
        </St.Login>
    </St.Container>
  )
}

export default LoginForm;
